"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Seasonal affective disorder (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/seasonal-affective-disorder-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H282385678\">",
"      <span class=\"h1\">",
"       What is seasonal affective disorder?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Seasonal affective disorder (often called &ldquo;SAD&rdquo;) is a form of depression that comes and goes depending on the time of year. There are 2 main types of the disorder:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Fall-onset SAD",
"        </strong>",
"        &ndash; This type of SAD starts in late fall and goes away in the spring and summer. Some people call it &ldquo;winter depression.&rdquo; It is the most common form of SAD.",
"       </li>",
"       <li>",
"        <strong>",
"         Spring-onset SAD",
"        </strong>",
"        &ndash; This type of SAD starts in the spring and goes away in the fall and winter. Spring-onset SAD is much less common than fall-onset SAD.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H282385693\">",
"      <span class=\"h1\">",
"       What are the symptoms of SAD?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms are different depending on which form of SAD a person has.",
"     </p>",
"     <p>",
"      People with fall-onset SAD tend to:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Sleep more than usual",
"       </li>",
"       <li>",
"        Have a bigger appetite than usual, especially for sweet or starchy foods, like pastries or rice",
"       </li>",
"       <li>",
"        Gain weight",
"       </li>",
"       <li>",
"        Become cranky or irritable",
"       </li>",
"       <li>",
"        Have trouble with their relationships, especially if they feel like they are being rejected",
"       </li>",
"       <li>",
"        Feel as though their arms and legs are weighted down or filled with lead",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People with spring-onset SAD have symptoms that are more like those of typical depression. They tend to:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Sleep less than usual",
"       </li>",
"       <li>",
"        Have a smaller appetite",
"       </li>",
"       <li>",
"        Lose weight",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H282385708\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes, if you have symptoms of SAD, see a doctor, nurse, or counselor.",
"     </p>",
"     <p>",
"      If you ever feel like you might hurt yourself or someone else, do 1 of these things:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Call your doctor or nurse and tell them it is an emergency",
"       </li>",
"       <li>",
"        Call 9-1-1 for an ambulance",
"       </li>",
"       <li>",
"        Go to the emergency room at your local hospital",
"       </li>",
"       <li>",
"        Contact the National Suicide Prevention Lifeline:",
"       </li>",
"       <li>",
"        1-800-273-8255",
"       </li>",
"       <li>",
"        <a class=\"external\" href=\"file://www.suicidepreventionlifeline.org/\">",
"         www.suicidepreventionlifeline.org",
"        </a>",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H282385723\">",
"      <span class=\"h1\">",
"       How is seasonal affective disorder treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment options include the following:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Light therapy",
"        </strong>",
"        &ndash; Light therapy involves sitting in front of special, bright lamps during the day. This form of therapy can help people with fall-onset SAD. It must be done with help of a doctor or counselor who knows how the therapy works. It&rsquo;s not something people should try to do on their own.",
"       </li>",
"       <li>",
"        <strong>",
"         Medicines called antidepressants",
"        </strong>",
"        &ndash; The same medicines used to treat depression can help people with SAD. It&rsquo;s not clear whether it makes sense to stop and start the medicines every year, based on when SAD usually starts. There are many different antidepressant medicines that doctors can prescribe. The medicines work in different ways and can cause different side effects. If 1 medicine causes problems or does not work, there are often others to try.",
"       </li>",
"       <li>",
"        <strong>",
"         Counseling",
"        </strong>",
"        <strong>",
"         (also called &ldquo;psychotherapy&rdquo;)",
"        </strong>",
"        &ndash; There is no direct proof that counseling specifically helps with SAD. But there is good proof that it helps with depression, so experts think it can also help with SAD.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Experts think that light therapy is often the best treatment to try first for fall-onset SAD, but only if the person is not severely depressed or thinking about suicide. For people who are severely depressed or thinking about suicide, antidepressant medicines might be a better option.",
"     </p>",
"     <p>",
"      You and your doctor, nurse, or counselor can decide which treatment is best for you. Some people do well if they combine different treatments.",
"     </p>",
"     <p>",
"      Whatever treatment you try, keep in mind that it sometimes takes patience to find a treatment that works. In some cases, people who take medicines have to try a few different medicines before they find 1 that works for them. Plus, most treatments take some time before they start working. The key is to work with your doctor, nurse, or counselor, and to keep him or her informed about any problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H282385738\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Some people feel better if they exercise. Even you do not feel like it, try to do something active for at least 30 minutes on most days of the week. There is some proof that the brain makes its own antidepressants during exercise.",
"     </p>",
"     <p>",
"      Also, if you have fall-onset SAD, make sure you get exposed to as much light as possible. Here are some ways you can do that:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Take walks outside during the day, so that you get some sun.",
"       </li>",
"       <li>",
"        In your bedroom, put a lamp on a timer and have it turn on in the early morning, even before the sun comes out.",
"       </li>",
"       <li>",
"        Get a &ldquo;dawn-simulating&rdquo; lamp, which brightens gradually and turns on before the sun comes out.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H282385753\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
