var title_f2_51_2871="Cumulative incidence of hepatocellular carcinoma";
var content_f2_51_2871=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F83282&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F83282&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 636px\">",
"   <div class=\"ttl\">",
"    Cumulative incidence of hepatocellular carcinoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 616px; height: 973px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Cumulative incidence of hepatocellular carcinoma by:",
"    <br/>",
"    (A) Group of long-term HBV DNA change.",
"    <br/>",
"    (B) Long-term pattern of ALT.",
"    <br/>",
"    Both P values for log-rank tests were &lt;0.001.",
"    <div class=\"footnotes\">",
"     * Data were not available for 326 participants because of &lt;2 measurements of ALT level.",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      ALT level &ge;45 U/L in &ge;50 percent of sequential ALT measurements.",
"      <br>",
"       &Delta; At least one ALT level &ge;45 U/L but &lt;50 percent of sequential ALT measurements &ge;45 U/L.",
"       <br>",
"        <font class=\"lozenge\">",
"         &loz;",
"        </font>",
"        All sequential ALT measurements &lt;45 U/L and at least one ALT level &gt;30 U/L.",
"        <br>",
"         &sect; All sequential ALT measurements &le;30 U/L.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Chen CF, Lee WC, Yang HI, et al. Changes in serum levels of HBV DNA and alanine aminotransferase determine risk for hepatocellular carcinoma. Gastroenterology 2011; 141:1240. Illustration used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
