var title_f2_51_2876="Neurologic predictors of prognosis after cardiac arrest";
var content_f2_51_2876=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F79948&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F79948&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Significance of physical findings in coma following cardiac arrest",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_left\" colspan=\"2\" rowspan=\"1\">",
"        Patients with virtually no chance of regaining independence",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Initial examination",
"       </td>",
"       <td>",
"        No pupillary light reflex",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        One day",
"       </td>",
"       <td>",
"        Motor response no better than flexor and spontaneous eye movements neither orienting nor roving conjugate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Three days",
"       </td>",
"       <td>",
"        Motor response no better than flexor, no spontaneous eye opening",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        One week",
"       </td>",
"       <td>",
"        Motor response not obeying commands and spontaneous eye movements neither orienting nor roving conjugate.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Two weeks",
"       </td>",
"       <td>",
"        Oculocephalic response not normal, not obeying commands, no",
"spontaneous eye opening, eye opening not improved at least 2 grades",
"from initial examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\" colspan=\"2\" rowspan=\"1\">",
"        Patients with best chance of regaining independence",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Initial examination",
"       </td>",
"       <td>",
"        Pupillary light reflexes present and motor response flexor or extensor. Spontaneous eye movements roving conjugate or orienting",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        One day",
"       </td>",
"       <td>",
"        Motor response withdrawal or better and eye opening improved at least 2 grades",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Three day",
"       </td>",
"       <td>",
"        Motor response withdrawal or better and spontaneous eye movements normal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        One week",
"       </td>",
"       <td>",
"        Motor response obeying commands",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Two weeks",
"       </td>",
"       <td>",
"        Normal oculocephalic response",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
